import React, { Component } from 'react';
class ClientsHeader extends Component {
    render() {
        return (
            <div id="clientsHeader"><span>Name</span> <span>Surname</span> <span>Country</span> <span>First contact</span> <span>Email</span> <span>Sold</span> <span>Owner</span></div>
        )
    }
}
export default ClientsHeader;
